const instagram_account = $input.first().json['Instagram Account'];
const tiktok_account = $input.first().json['Tik Tok'];
const facebook_account = $input.first().json['Facebook'];

const social_networks = [];

if (instagram_account.trim()){
  social_networks.push({
    platform: 'Instagram',
    account: instagram_account.trim()
  })
}

if (tiktok_account.trim()){
  social_networks.push({
    platform: 'Tik Tok',
    account: tiktok_account.trim()
  })
}

if (facebook_account.trim()){
  social_networks.push({
    platform: 'Facebook',
    account: facebook_account.trim()
  })
}

return social_networks.map(item =>({json: item}));
